(18, 31, 'Two Infinity cake topper', 'cake topper', 21.98, 'toy story cake topper', 'null', '[\"uploads\\/listing\\/1742060347_67d5bb3bc6604.jpeg\"]', '6', '10', '7', 'TMF', '{\"Title\":\"Two Infinity and Beyond Cake Topper - Perfect Birthday Decoration for Kids Parties, Unique Design\",\"BrandName\":\"The Maker Factory\",\"Manufacturer\":\"The Maker Factory\",\"ModelNumber\":\"TOY-CAKE-02\",\"ModelName\":\"Toy Story Theme Cake Topper\",\"GenericKeywords\":\"birthday decoration; kids party; Toy Story; cake topper; themed decoration\",\"NumberOfItems\":\"1\",\"PartNumber\":\"TMF-TOY-CAKE-TOPPER\",\"ProductID\":\"B07XYZ1234\",\"SearchTerms\":\"birthday party decoration cake topper Toy Story theme\",\"Description\":\"Transform your child\'s birthday celebration with our Two Infinity and Beyond Cake Topper, a delightful addition to any Toy Story themed party. Crafted with precision, this cake topper not only adds a whimsical touch to your cake but also serves as a memorable keepsake for years to come.\\n\\nOur cake topper is designed with vibrant colors and intricate details, reflecting the beloved characters and themes from the classic Toy Story series. Made from high-quality, non-toxic materials, this cake topper is safe for children and perfect for indoor or outdoor parties.\\n\\n**Feature Breakdown:**\\n- **Unique Design:** Our Two Infinity and Beyond Cake Topper features a one-of-a-kind design inspired by Toy Story, making it a standout addition to any birthday cake.\\n- **High-Quality Material:** Made from durable, food-safe materials that ensure long-lasting use and safety.\\n- **Easy to Use:** Simply place the topper on your cake for an instant upgrade to your party decor.\\n- **Reusable:** Not only perfect for one-time use, but it can also be saved as a keepsake.\\n\\n**Use Cases & Applications:**\\nThis cake topper is perfect for birthday parties, themed events, or any celebration where you want to add a touch of magic. It\'s easy to apply and fits cakes of va