(1, 29, 'uploads/product-seo/1741994624.jpeg', 'Rabbit Shape Keychain', '50', '10', '50', 'united States of America', 'Arizona', 'https://3daiprint.com/', 'Rabbit Shape Keychain', '\n{\n  \"product_title\": \"Cute Rabbit Shape Keychain Set - 3 Colors\",\n  \"meta_description\": \"Discover our charming Rabbit Shape Keychain set, featuring three vibrant colors: white, pink, and yellow. Perfect for adding a playful touch to your keys or bag. Made in Arizona, USA.\",\n  \"alt_text\": \"Rabbit shape keychain set in white, pink, and yellow\",\n  \"product_description\": \"Add a touch of whimsy to your accessories with our adorable Rabbit Shape Keychain set. This collection includes three keychains in delightful white, pink, and yellow hues. Each keychain is crafted with care in Arizona, USA, and is perfect for personalizing your keys or bag. Durable and stylish, these keychains make a great gift or a fun treat for yourself.\",\n  \"seo_keywords\": [\"Rabbit Shape Keychain\", \"Cute Keychains\", \"Keychain Set\", \"Rabbit Keychain\", \"Colorful Keychains\"],\n  \"product_link\": \"https://3daiprint.com/\"\n}', '2025-03-14 23:23:44', '2025-03-14 23:24:08'),
(2, 29, 'uploads/product-seo/1741995155.jpeg', 'Rabbit Shape Keychain', '50', '15', '50', 'united States of America', 'Arizona', 'https://3daiprint.com/', 'Rabbit Shape Keychain, Keychain, Rabbit Shape', '\n{\n  \"product_title\": \"Colorful Rabbit Shape Keychain Set - Cute Accessory for Bags and Keys\",\n  \"meta_description\": \"Discover our adorable Rabbit Shape Keychain set, perfect for adding charm to your keys or bags. Available in white, pink, and yellow, these keychains are made with durable materials. Ideal for gifting and personal use.\",\n  \"alt_text\": \"Three colorful rabbit shape keychains in white, pink, and yellow with metal clasps.\",\n  \"product_description\": \"Add a touch of whimsy to your everyday essentials with our Rabbit Shape Keychain set. These charming keychains come in three delightful colors: white, pink, and yellow. Crafted from high-quality materials, they are both durable and stylish, making them perfect for keys, backpacks, or handbags. Whether you\'re looking for a cute gift or a personal accessory, these rabbit keychains are a delightful choice.\",\n  \"seo_keywords\": [\"Rabbit Shape Keychain\", \"Cute Keychain Accessories\", \"Colorful Rabbit Keychains\", \"Keychain Gifts\", \"Durable Keychains\"],\n  \"product_link\": \"https://3daiprint.com/\"\n}', '2025-03-14 23:32:35', '2025-03-14 23:32:42'),
